import React, { useState, useEffect } from "react"

function VisualizationQuestionDisplay() {
  const [visualizationTitle, setVisualizationTitle] = useState("h")
  return (
    <section class = "section">
        <h2 class = "is-size-3 is-family-secondary has-text-weight-bold">{visualizationTitle} Icon Array</h2>
    </section>
  )
}

export default VisualizationQuestionDisplay
